import React, {Component} from 'react';
import {Link} from "react-router-dom";
import {LINK_FACEBOOK, LINK_INSTAGRAM, LINK_LINKEDIN} from "../config/configuration";

class Footer extends Component {
    render() {
        return (
            <div className={'footer container-fluid'}>
                <div className={'container nav justify-content-end'}>
                    <ul className={'nav justify-content-end'}>
                        <li className={'nav-item'}>
                            <a href={LINK_INSTAGRAM} target={"_blank"} className="nav-link">
                                <span>Instagram</span>
                            </a>
                        </li>

                        <li className={'nav-item'}>
                            <a href={LINK_FACEBOOK} target={'_blank'} className="nav-link">
                                <span>Facebook</span>
                            </a>
                        </li>

                        <li className={'nav-item'}>
                            <a href={LINK_LINKEDIN} target={'_blank'} className="nav-link">
                                <span>LinkedIn</span>
                            </a>
                        </li>
                    </ul>
                </div>
            </div>
        );
    }
}

export default Footer;
